/*
@cyan:         #35a766;
@blue:         #5977d3;
@purple:       #8100c6;
@green:        #8fad06;
@red:          #d24d4d;
@orange:       #cd8e21;
@light-orange: #e3a92d;
*/
.github-GitTimingsView {
  width: 100%;
  height: 100%;
  overflow: auto;
}
.github-GitTimingsView-header {
  display: flex;
  justify-content: flex-end;
  padding: 10px;
  border-bottom: 1px solid #f1f3f5;
}
.github-GitTimingsView .waterfall-widget {
  border-radius: 2px;
  border: 1px solid #f1f3f5;
  background-color: #fff;
  margin: 10px;
}
.github-GitTimingsView .waterfall-header {
  padding: 5px 5px 0 5px;
  color: #212529;
  font-size: 12px;
  display: flex;
  border-bottom: 1px solid #f1f3f5;
}
.github-GitTimingsView .waterfall-header .collapse-toggle {
  cursor: pointer;
  margin-right: 2px;
}
.github-GitTimingsView .waterfall-header-text {
  flex: 1;
}
.github-GitTimingsView .waterfall-header-controls {
  flex-basis: 250px;
  display: flex;
  align-items: center;
}
.github-GitTimingsView .waterfall-export-button {
  margin: 0 10px 3px 0;
}
.github-GitTimingsView .waterfall-scroller {
  overflow: auto;
}
.github-GitTimingsView .waterfall-container {
  position: relative;
  display: inline-block;
  min-width: 100%;
}
.github-GitTimingsView .waterfall-time-marker {
  position: absolute;
  height: 100%;
  width: 1px;
  border-left: 1px solid #f1f3f5;
}
.github-GitTimingsView .waterfall-timeline {
  position: relative;
  margin: 5px 0;
}
.github-GitTimingsView .waterfall-timeline-label {
  position: absolute;
  padding-left: 5px;
  color: #212529;
}
.github-GitTimingsView .waterfall-row {
  position: relative;
  min-height: 15px;
  padding: 2px 0;
}
.github-GitTimingsView .waterfall-row:nth-child(2n+1) {
  background-color: #fff;
}
.github-GitTimingsView .waterfall-row:hover {
  background-color: #f1f3f5;
}
.github-GitTimingsView .waterfall-row-label {
  position: relative;
  margin: 0 5px;
  white-space: nowrap;
}
.github-GitTimingsView .waterfall-marker {
  position: absolute;
  top: 2px;
  bottom: 2px;
}
.github-GitTimingsView .waterfall-marker-section {
  display: inline-block;
  position: relative;
  height: 100%;
  vertical-align: top;
}
